import Card from './Card';

const CardList = ({robots}) => {
  const { id, name, username, email } = robots;
  return (
    <div>
      {robots.map(() => (
          <Card 
            id={id}
            name={name}
            username={username}
            email={email}
          />
        ))}
    </div>
  )
}

export default CardList
